drop table if exists route;
create table route
(
    route_uid         char(255)                           not null,
    created_at  timestamp with time zone default CURRENT_TIMESTAMP,
    due_dt      timestamp with time zone           not null,
    delivery_at timestamp with time zone           not null
);


drop table if exists checkpoint;
create table checkpoint
(
    id                       serial                   not null
        constraint checkpoint_pkey
            primary key,
    created_at               timestamp with time zone default CURRENT_TIMESTAMP,
    order_number             smallint                 not null,
    edge_id                  bigint                   not null,
    start_point_id           bigint                   not null,
    start_point_movement_in  timestamp with time zone not null,
    start_point_movement_out timestamp with time zone not null,
    end_point_id             bigint                   not null,
    end_point_movement_in    timestamp with time zone not null,
    end_point_movement_out   timestamp with time zone not null,
    route_uid                 integer,
    end_point_arrival        timestamp with time zone
);

